class App extends Component {
  render() {
    return (
      <div className="container">
        <NavBar />
        <section className="row">
          <Switch>
            <div className="col-8 offset-2">
              <Posts />
            </div>
          </Switch>
        </section>
      </div>
    );
  }
}

export default App;
